import styled from "styled-components";


const Gallery = styled.div`
  display: flex;
  flex-wrap: wrap;
  align-content: space-between;
  height: fit-content;
  justify-content: center;
  max-width: 380px;
  padding-right: 110px;
`;


export default Gallery;
